import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes";

console.log(notes);
function App() {
    return (
        <div>
            <Header />
            <Note 
                title="Note Title" 
                content="Note Content"
            />
            <Footer />
        </div> 
    );
}

export default App;
